import React from "react";

import { StyleSheet, Text, View } from "react-native";
import {Box, Heading} from "native-base"


import { Button, VStack,
    Image,
    ScrollView,
    Center,
    NativeBaseProvider, } from "native-base";
import Footer from "../footer/Footer";
import TripUpdateModal from "../trips/TripUpdateModal";

const Home = ({ navigation }) => {
  return (
      
    <View>
  <ScrollView px="20">
      <Center mt="3">
        <VStack space={2} alignItems="center" safeAreaTop my={6}>
          {[ "100"].map((size) => (
            <Image
              size={size}
              resizeMode="cover"
              source={{
                uri: "https://wakingupwild.com/wp-content/uploads/slider-safety-2.jpg",
              }}
              alt={"Alternate Text " + size}
            />
          ))}
        </VStack>
      </Center>
    </ScrollView>
      <Box>
        <Heading size="xl" mb="4">
          Trip
        </Heading>
        <Text fontSize="xl">
          (noun) a journey or excursion, especially for pleasure.
        </Text>
      </Box>
      <Footer navigation={navigation} />
      {/* <Text> Hi </Text> */}
      <Button title="NOMAD" color="#0000ff" onPress={() => alert("WELCOME")} />
<TripUpdateModal/>
      {/* <Footer navigation={navigation}/> */}
      {/* <Text> Hi </Text> */}
      <Button
        title="NOMAD"
        color="#0000ff"
        width="50"
        height="50"
        onPress={() => navigation.navigate("TripList")}
      >Trip List</Button>
      <Button
        title="NOMAD"
        color="#0000ff"
        width="50"
        height="50"
        onPress={() => navigation.navigate("Signin")}
      >Sign in</Button>
            <Button
        title="NOMAD"
        color="#0000ff"
        width="50"
        height="50"
        onPress={() => navigation.navigate("ProfileList")}
      >Profile</Button>


      {/* <Button 
             title="signin"
             onPress={() => navigation.navigate("Signin")}
             /> */}
    </View>
  );
};

export default Home;

const styles = StyleSheet.create({});
